 def  loadin(self,list1):
  a=rn.randint(1,1000)
  file1=open("clicked_Aria.txt","r")
  file2=open("Aria_save.txt","r")
  cont=file1.readlines()
  add=file2.readlines()
  cont=[x.strip() for  x  in   cont]
  add=[x.strip()    for  x  in  add]  
  
  add1=add[0]
  add2=add[1]
  cont1=cont[0]
  cont2=cont[1]
  cont3=cont[2]
  address=add1+'/'+add2+'/'+cont1+str(a)+'.txt'
  files=open(address,'w')
  files.write(cont2+'\n')
  files.write(cont3+'\n')
  
  for  i  in  list1:
   files.write(i)
   files.write('\n')
  files.close()
  file1.close()
  file2.close()
